CREATE TABLE `tbl_agent_sales` (
  `agent_sales_id` int(11) NOT NULL,
  `withdrawal_status` int(1) DEFAULT '0' COMMENT '0 = Fully served ; 1 = Pending',
  `sales_invoice` int(11) NOT NULL,
  `reference_number` varchar(30) NOT NULL DEFAULT '',
  `customer_id` int(11) NOT NULL,
  `for_pick_up` int(1) NOT NULL DEFAULT '0' COMMENT '1 = Yes; 0 = No',
  `status` varchar(1) NOT NULL DEFAULT 'S' COMMENT 'F',
  `sales_type` varchar(1) NOT NULL DEFAULT 'C' COMMENT 'C=Cash;H=Charge',
  `remarks` varchar(255) NOT NULL DEFAULT '',
  `sales_date` date NOT NULL,
  `paid_status` varchar(1) NOT NULL DEFAULT '0' COMMENT 'COMMENT ''1 = Paid; 0 = Unpaid'',',
  `sales_summary_id` int(11) NOT NULL,
  `reward_points` decimal(6,2) NOT NULL DEFAULT '0.00',
  `terms` int(3) NOT NULL,
  `encoded_by` int(11) NOT NULL,
  `date_added` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `date_last_modified` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `discount_id` int(11) NOT NULL DEFAULT '0' COMMENT 'Manual Discounts',
  `pullout_detail_id` int(11) NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

--
-- Triggers `tbl_agent_sales`
--
DELIMITER $$
CREATE TRIGGER `cancel_agent_sales` AFTER UPDATE ON `tbl_agent_sales` FOR EACH ROW UPDATE tbl_agent_product_transactions SET status = 0,user_id = NEW.encoded_by WHERE header_id = NEW.agent_sales_id AND module = 'ASLS' AND NEW.status = 'C'
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `delete_agent_sales` AFTER DELETE ON `tbl_agent_sales` FOR EACH ROW DELETE FROM tbl_agent_sales_details WHERE agent_sales_id = OLD.agent_sales_id
$$
DELIMITER ;

