--
-- Triggers `tbl_agent_sales_details`
--
DELIMITER $$
CREATE TRIGGER `delete_agent_sales_detail` AFTER DELETE ON `tbl_agent_sales_details` FOR EACH ROW DELETE FROM tbl_agent_product_transactions WHERE header_id = OLD.agent_sales_id AND detail_id = OLD.agent_sales_detail_id AND module = 'ASLS'
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `update_agent_sales_detail` AFTER UPDATE ON `tbl_agent_sales_details` FOR EACH ROW UPDATE tbl_agent_product_transactions SET quantity = NEW.quantity,actual_qty = NEW.actual_qty,cost = NEW.cost,price = NEW.price WHERE header_id = OLD.agent_sales_id AND detail_id = OLD.agent_sales_detail_id AND module = 'ASLS'
$$
