CREATE TRIGGER `finish_adjustment` AFTER UPDATE ON `tbl_inventory_adjustments` FOR EACH ROW BEGIN 
	UPDATE tbl_product_transactions SET status = IF (NEW.status = 'F', 1, 0),branch_id = IF (NEW.status = 'F', NEW.branch_id, 0), warehouse_id = IF (NEW.status = 'F', NEW.warehouse_id, 0) WHERE header_id = NEW.adjustment_id AND module = 'IA';
