--
-- Table structure for table `tbl_product_transactions`
--

CREATE TABLE `tbl_product_transactions` (
  `transaction_id` int(11) NOT NULL,
  `branch_id` int(11) NOT NULL,
  `warehouse_id` int(11) NOT NULL,
  `sku_id` int(11) NOT NULL,
  `product_id` int(11) NOT NULL,
  `packaging_id` int(11) NOT NULL,
  `quantity` decimal(12,2) NOT NULL,
  `actual_qty` decimal(12,2) NOT NULL,
  `cost` decimal(12,5) NOT NULL,
  `price` decimal(12,2) NOT NULL,
  `header_id` int(11) NOT NULL,
  `detail_id` int(11) NOT NULL,
  `module` varchar(3) NOT NULL COMMENT 'SLS=Sales',
  `type` varchar(3) NOT NULL COMMENT 'IN,OUT',
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '1=Finished;0=Saved',
  `served_status` int(1) NOT NULL DEFAULT '0' COMMENT '1=Served;0=To Serve',
  `served_qty` decimal(12,2) NOT NULL,
  `served_transaction_id` int(11) NOT NULL COMMENT 'source transaction id',
  `date_added` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `date_last_modified` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `transaction_date` date NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

