CREATE TABLE `tbl_pullout` (
  `pullout_id` int(11) NOT NULL,
  `reference_number` varchar(30) NOT NULL,
  `branch_id` int(11) NOT NULL,
  `po_id` int(11) NOT NULL,
  `warehouse_id` int(11) NOT NULL,
  `pullout_date` date NOT NULL,
  `pullout_type` varchar(1) NOT NULL COMMENT 'A = Agent; B = Branch',
  `remarks` varchar(255) NOT NULL,
  `pullout_return_status` varchar(1) NOT NULL DEFAULT 'S' COMMENT 'S = Saved; F = Finished',
  `received_status` varchar(1) NOT NULL DEFAULT 'S' COMMENT 'S = Saved; F = Finished; For Receiving of Requesting Branch',
  `status` varchar(1) NOT NULL DEFAULT 'S' COMMENT 'S = Saved; F = Finished',
  `encoded_by` int(11) NOT NULL,
  `sales_summary_id` int(11) NOT NULL,
  `date_added` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `date_last_modified` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

