--
-- Triggers `tbl_pullout`
--
DELIMITER $$
CREATE TRIGGER `delete_por` AFTER DELETE ON `tbl_pullout` FOR EACH ROW DELETE FROM tbl_pullout_details WHERE pullout_id = OLD.pullout_id
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `finish_por` AFTER UPDATE ON `tbl_pullout` FOR EACH ROW BEGIN 
	UPDATE tbl_product_transactions SET status = IF (NEW.status = 'F', 1, 0),branch_id = IF (NEW.status = 'F', NEW.branch_id, 0), warehouse_id = IF (NEW.status = 'F', NEW.warehouse_id, 0), transaction_date=NEW.pullout_date WHERE header_id = NEW.pullout_id AND module = 'PUL';
	UPDATE tbl_product_transactions AS po, tbl_product_transactions AS pin SET pin.served_status = IF (NEW.status = 'F', 1, 0),pin.served_qty = IF (NEW.status = 'F', po.quantity, 0) WHERE po.served_transaction_id = pin.transaction_id AND po.module = 'PUL' AND po.header_id = NEW.pullout_id;
	UPDATE tbl_purchase_order SET pullout_status = 'F' WHERE po_id = NEW.po_id AND NEW.status = 'F';
 END
$$
DELIMITER ;

